import React from 'react';
import * as S from "./MainPage.styled";
import IconSearch1 from "../../Assets/IconSearch1.svg";
import mobileMenu from "../../Assets/mobileMenu.svg";
import MusicNote from "./MusicNote";
import RightArrow from "./RightArrow";
import SelectIdiomButton from "./SelectIdiomButton";
import { Link, Router, Switch, Route } from "react-router-dom";
import SelectIdiom from "../SelectIdiomPage/SelectIdiom"

function MainPage() {
  let location = useLocation();
  console.log(location);
  return ( 
    <div>
      <S.MainWrapper>
        <Router>
          <S.Nav>
            <button><img alt="Search Option" src={IconSearch1}/></button>
            <Link to="/"><SelectIdiomButton>Select Idiom/Style</SelectIdiomButton></Link>
            <button><img alt="Mobile Menu" aria-label="Mobile Menu" src={mobileMenu}/></button>
          </S.Nav>
          <S.Background>
            <MusicNote />
            <h1>The Hills of Kintail</h1>
            <RightArrow />
          </S.Background>

          <Switch>
            <Route path="/">
              <SelectIdiom />
            </Route>
          </Switch>  
        </Router>
      </S.MainWrapper>
    </div>    



  )

}

export default MainPage;
